import Vue from "vue";
import VueRouter from "vue-router";

// rotas ...
import loginRouter from "../pages/login/router";
import errorRouter from "../pages/error/router";
import testeRouter from "../pages/testes/router";
import consultaRouter from "../pages/consulta/router";
import consultasRouter from "../pages/consultas/router";
import omRouter from "../pages/om/router";
import coletaRouter from "../pages/coleta/router";
import sitemapRouter from "../pages/sitemap/router";
import maquinasuzRouter from "../pages/maquinasuz/router";
import dashboardmaquinasuzRouter from "../pages/dashboard_maquina/router";
import wmsRouter from "../pages/wms/router";
import transpRouter from "../pages/transp/router";
import producaoidelliRouter from "../pages/producaoidelli/router";
import pedidosRouter from "../pages/pedidos/router";
import covidRouter from "../pages/covid/router";
import almoxarifadoRouter from "../pages/almoxarifado/router";
import expedicaoRouter from "../pages/expedicao/router";
import chatRouter from "../pages/chat/router";
import contabRouter from "../pages/contabilidade/router";
import pixRouter from "../pages/pix/router";
import ecommerceRouter from "../pages/ecommerce/router";
import ramaisRouter from "../pages/ramais/router";
import mapaestoqueRouter from "../pages/MapaEstoque/router";
import pedidosacessoriosRouter from "../pages/pedidosacessorios/router";
import adminRouter from "../pages/admin/router";
import usuarioRouter from "../pages/usuario/router";
import caixasaidaRouter from "../pages/caixasaida/router";
import gestoresRouter from "../pages/gestores/router";
import funcionariosRouter from "../pages/funcionarios/router";
import iframeRouter from "../pages/iframe/router";
import fichatecnicaRouter from "../pages/fichatecnica/router";
import despesasRouter from "../pages/despesas/router";
import arquivosdirectoryRouter from "../pages/arquivosdirectory/router";
import nfeRouter from "../pages/nfe/router";
import chamadosRouter from "../pages/chamados/router";
import builderRouter from "../pages/builder/router";
import carregamentoRouter from "../pages/carregamento/router";
import clientesRouter from "../pages/clientes/router";
import planejadosRouter from "../pages/planejados/router";
import impressoesRouter from "../pages/impressoes/router";
import segurancaRouter from "../pages/seguranca/router";
import OEARouter from "../pages/OEA/router";
import controleluz from "../pages/controleluz/router";
import automacao_consulta_pecasRouter from "../pages/automacao_consulta_pecas/router";
import vendaB2BRouter from "../pages/vendaB2B/router";


Vue.use(VueRouter);

const routes = [
  {
    path: "/",
    name: "Home",
    component: () => import("../views/Home.vue"),
    children: [{ path: "/home" }],
  },
  {
    path: "/page404",
    name: "Page404",
    component: () => import("../views/Page404.vue"),
    children: [{ path: ":page" }],
  },
  {
    path: "/about",
    name: "About",
    component: () => import("../views/About.vue"),
  },
  {
    path: "/grid",
    name: "Grid",
    component: () => import("../pages/GridLayout/views"),
	},
	{
    path: "/politicaseguranca",
    name: "PoliticaSeguranca",
    component: () => import("../components/PoliticaSeguranca"),
	},
	{
    path: "/imgseguranca",
    name: "ImgSeguranca",
    component: () => import("../views/ImgSeguranca"),
  },

  // rotas moduladas ...
  ...loginRouter,
  ...errorRouter,
  ...testeRouter,
  ...consultasRouter,
  ...omRouter,
  ...coletaRouter,
  ...sitemapRouter,
  ...maquinasuzRouter,
  ...dashboardmaquinasuzRouter,
  ...wmsRouter,
  ...transpRouter,
  ...producaoidelliRouter,
  ...pedidosRouter,
  ...covidRouter,
  ...almoxarifadoRouter,
  ...expedicaoRouter,
  ...chatRouter,
  ...contabRouter,
  ...pixRouter,
  ...ecommerceRouter,
  ...ramaisRouter,
  ...mapaestoqueRouter,
  ...pedidosacessoriosRouter,
  ...adminRouter,
  ...usuarioRouter,
  ...caixasaidaRouter,
  ...gestoresRouter,
  ...funcionariosRouter,
  ...iframeRouter,
  ...fichatecnicaRouter,
  ...despesasRouter,
  ...arquivosdirectoryRouter,
  ...nfeRouter,
  ...chamadosRouter,
  ...builderRouter,
  ...consultaRouter,
  ...carregamentoRouter,
	...clientesRouter,
	...planejadosRouter,
	...impressoesRouter,
	...segurancaRouter,
	...OEARouter,
	...controleluz,
	...automacao_consulta_pecasRouter,
	...vendaB2BRouter,


  {
    path: "*",
    redirect: "/page404",
  },
];

// routes.push(ramaisRouter)

const router = new VueRouter({
  mode: "history",
  base: process.env.BASE_URL,
  routes,
  scrollBehavior() {
    // d√° scroll para o topo da tela
    return { x: 0, y: 0, behavior: "smooth" };
  },
});

export default router;
